import popeImage from '../src/assets/imgs/pope.png'
import PolygonImage from '../src/assets/imgs/Closing.png'



function App() {
  return (
    <div>
      <Header>
        <StyledHeaderImage src={popeImage} />
        <InfoAboutBlurredContainer>

        </InfoAboutBlurredContainer>
        <NavigationBar>
          <HomeText>jfjfjf</HomeText>
          <Ul>
            <Li>vfvfv ev</Li>
            <Li>efvf</Li>+
            <Li>ihrfniwv</Li>
          </Ul>
        </NavigationBar>
        <Polygon src={PolygonImage} />
      </Header>
    </div>
  );
}

export default App;
